max_degree = 50
for degree in range(1, max_degree+1):
    # Fit a polynomial regression model
    poly_features = PolynomialFeatures(degree=degree)
    X_train_poly = poly_features.fit_transform(X_train)
    X_test_poly = poly_features.transform(X_test)
    X_val_poly = poly_features.transform(X_val)

    poly_model = LinearRegression()
    poly_model.fit(X_train_poly, y_train)

    # Calculate MSE for both training, test and validation sets
    train_mse.append(mean_squared_error(y_train, poly_model.predict(X_train_poly)))
    val_mse.append(mean_squared_error(y_val, poly_model.predict(X_val_poly)))
    test_mse.append(mean_squared_error(y_test, poly_model.predict(X_test_poly)))

# Visualize the MSE vs Polynomial Degree
plt.figure(figsize=(15,5))
plt.plot(range(1, max_degree+1), train_mse, label='Training MSE', marker='o')
