plt.plot(range(1, max_degree+1), test_mse, label='Test MSE', marker='o')
plt.xlabel('Polynomial Degree')
plt.ylabel('Mean Squared Error')
plt.title('MSE vs Polynomial Degree')
plt.legend()
plt.xticks(range(1, max_degree+1))
plt.grid(True)

plt.show()

